const SizeChartScreen = () => {
	return (
		<>
			<div>
				<h1> Size Chart for Women </h1>
				<img src="/images/women.png" />
			</div>

			<div>
				<h1> Size Chart for Men </h1>
				<img src="/images/blogs.jpg" style={{ marginTop: '20px' }} />
			</div>
		</>
	);
};

export default SizeChartScreen;
